// http://stackoverflow.com/a/8567199
// all combinations
function combinations($arrays, $i = 0) {
    if (!isset($arrays[$i])) {
        return array();
    }
    if ($i == count($arrays) - 1) {
        return $arrays[$i];
    }

    // get combinations from subsequent arrays
    $tmp = combinations($arrays, $i + 1);

    $result = array();

    // concat each array from tmp with each element from $arrays[$i]
    foreach ($arrays[$i] as $v) {
        foreach ($tmp as $t) {
            $result[] = join("", is_array($t) ? 
                array_merge(array($v), $t) :
                array($v, $t));
        }
    }

    return $result;
}

$obj = json_decode($json);

$tuple_length = 5;

$n = count($obj->hits->hits);

$tuples = array();

$t = array_values(
    combinations(
        array(
            array('A','C','G', 'T'), 
            array('A','C','G', 'T'), 
            array('A','C','G', 'T'), 
            array('A','C','G', 'T'), 
            array('A','C','G', 'T')
        )
    )
);

// intialise a list of all tuples set count to zero
$v = array();
foreach ($t as $x)
{
	$v[$x] = 0;
}
//print_r($v);

//exit();


for ($i = 0; $i < $n; $i++)
{
	$tuples[$i] = $v;
	
	$seq = $obj->hits->hits[$i]->_source->seq;
	
	//echo $seq . "\n";
	
	$len = strlen($seq);
	for ($j = 0; $j < $len - $tuple_length; $j++)
	{
		$tuple = substr($seq, $j, $tuple_length);
		
		// for now ignore tuples with missing values, etc.
		if (preg_match('/[ACGT]{5}/', $tuple))
		{
			$tuples[$i][$tuple]++;
		}
	}
	
	//print_r($tuples[$i]);
	
}

